const TestHome = () => {
  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        background: "red",
        display: "flex",
        flexDirection: "column",
      }}
    >
      <div style={{ flex: 1.5, width: "100%" }}>fsadf</div>
      <div
        style={{
          flex: 8.5,
          width: "100%",
          background: "green",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <div style={{ height: "98%", width: "99%", background: "white" }}></div>
      </div>
    </div>
  );
};

export default TestHome;
